  #ifndef _SHA_enum_
  #define _SHA_enum_
  /*
   *  All SHA functions return one of these values.
   */
  enum {
      shaSuccess = 0,
      shaNull,            /* Null pointer parameter */
      shaInputTooLong,    /* input data too long */
      shaStateError,      /* called Input after FinalBits or Result */
      shaBadParam         /* passed a bad parameter */
  };
  #endif /* _SHA_enum_ */
